import React from 'react'
import d from './Music.module.css';
import {compose} from "redux";
import {AuthRedirect} from "../hocs/AuthRedirect";
import ms from "./modal.module.css"

const Music = (props) => {
  return(
      <div className={ms.wrapper}>
          <p style={"roflan"}>
              <a href="#iw-modal" className="iw-modal-btn">Открыть модальное окно</a>
          </p>

    <div id="iw-modal" className={ms.iwModal}>

        <div className={ms.iwModalWrapper}>
            <div className={ms.iwCSSModalInner}>
                <div className={ms.iwModalHeader}>
                    <h3 className={ms.iwModalTitle}>Заголовок модального окна</h3>
                    <a href="#close" title="Закрыть" className={ms.iwClose}>×</a>
                </div>
                <div className={ms.iwModalText}>
                    <p>Здесь Вы можете разместить свой текст, изображения или формы обратной связи</p>
                </div>
            </div>
        </div>
    </div>
      </div>
   /* <!---end.Разметка для модального окна---->*/
)
}
export default compose(
    AuthRedirect
)(Music)
